import React from 'react'
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import Button from 'react-bootstrap/Button';

const Test = (props) => {

    props.data.map((contact) => {
        console.log("((()", contact.contact);
    })

    const deleteContactHandler = (id) => {
        props.remove(id);
    }


    return (
       props.data.map((contact, index) => {
        return (
            <>
            <div key={contact.id}>
            <Card bg='secondary' style={{ width: '18rem' }}>
            <Card.Body>
            <Card.Title>ID: {contact.id}</Card.Title>
            <Card.Text className='fs-2'> {contact.contact.name}</Card.Text>
            </Card.Body>
            <ListGroup className="list-group-flush">
            <ListGroup.Item>Phone: {contact.contact.phone}</ListGroup.Item>
            <ListGroup.Item>email: {contact.contact.email}</ListGroup.Item>
            <ListGroup.Item>
            <Button className="px-3" variant="danger" onClick={() => deleteContactHandler(contact.id)}>Delete</Button>
            </ListGroup.Item>
            </ListGroup>
            </Card>
            </div>
            </>
        )
       }) 
  )
}

export default Test
